import styled from 'styled-components';

const ProductsMainPageStyles = styled.section`
  position: relative;

  margin-top: 8rem;
  padding-left: 5rem;
  padding-right: 5rem;

  background: lightgray;

  margin-bottom: 10rem;
  h2 {
    font-size: 4rem;
    text-transform: uppercase;
    font-weight: 400;
  }

  .products_main-page {
    display: flex;
    flex-wrap: scroll;
    overflow-x: scroll;
    overflow-y: none;
  }

`;

export { ProductsMainPageStyles };
